    const Navigate = useNavigate()
    const [usuario, setUsuario] = useState('')
    const clinics = [
      {
        id: 1,
        name: "Clinic A",
        location: "Recife",
        imageUrl: "clinic-a.jpg",
      },
      {
        id: 2,
        name: "Clinic B",
